import {
    withGoogleMap,
    withScriptjs,
    GoogleMap,
    Marker,
    InfoWindow
} from 'react-google-maps';

import React from 'react'
import { useState } from 'react'
const center = {
    lat: 28.669155,
    lng: 77.453758,
};

export const Maps = () => {
    const { isLoaded } = withScriptjs({
        googleMapsApiKey: process.env.REACT_APP_GOOGLE_MAPS_API_KEY,

    })

    if (isLoaded) {
        return <h1>Map is not load yet</h1>
    }

    return (
        <GoogleMap defaultCenter={center} defaultZoom={13}>
            <Marker

                position={center}
            //   onClick={() => this.handleToggleOpen()}
            >

            </Marker>
        </GoogleMap>
    )
}
